import React from "react";
import Header from './Header';
import MainPane from './MainPane';
import { StickyContainer, Sticky } from 'react-sticky';


function TopPane(){
    return(
        <StickyContainer>

        <Sticky className='TopPane'>

            <Header/>
        </Sticky>
            <MainPane/>
        </StickyContainer>
    )
}
export default TopPane;
